import React from "react";
import Order from "./Order";

const OrderList = ({ displayOrders }) => {
  return (
    <React.Fragment>
      <div className="order-container">
        <ul className="order-list">
          <div className="order-header">
            <li className="order-header-item">Title</li>
            <li className="order-header-item">Description</li>
          </div>
          {displayOrders.map((orderObject) => (
            <Order orderObject={orderObject} key={orderObject._id} />
          ))}
        </ul>
      </div>
    </React.Fragment>
  );
};

export default OrderList;
